export class Recipe {

    /**
     *
     * @param id: string
     * @param name: string
     */
    constructor(name, ingridients) {
        this.id = null;
        this.name=name;
        this.ingridients= ingridients; //array
    }

    setId(id) {
        this.id = id;
    }

}
